%
%   This network data stems from the Pan European Grid Advanced Simulation and
%   State Estimation (PEGASE) project, funded by the European Union
%   (http://www.fp7-pegase.com/). The data is derived from the original data
%   [1] provided to Florin Capitanescu in 2013 under request by the data owners
%   in PEGASE project. Revisions to the original raw include: (i) removing data
%   related to a specific transmission system operator, which were replaced by
%   equivalent loads at the end of the three interconnection lines; (ii) some
%   asymmetrical PI branch models were approximated as symmetrical, averaging
%   parameters values; (iii) modeling simplifications concerning the
%   transformer transversal sustenance; (iv) data anonymization; (v) data
%   conversion from Eurostag (.ech) format in to the MATPOWER (.m) format; and
%   (vi) definition of various AC-OPF problems (see [2] below). Note that
%   AC-OPF formulations of this dataset have traditionally modeled thermal
%   limits in terms of current but this version of the dataset uses MVA limits.
%
%   This power system model contains 8,387 buses, 1,865 generators, 4,669 loads,
%   12,474 lines, 2,087 transformers (out of which 589 OLTC and 84 phases
%   shifters) and 178 shunt capacitors/reactors. Also, 1,299 lines and 529
%   transformers (out of which 17 phase shifters) have more than one circuit in
%   parallel. The system models 8 voltage levels: 750, 400, 380, 330, 220, 150,
%   120, and 110 kV. This data is a reasonable representation of the size and
%   complexity of the European transmission system. However, the data is
%   fictitious and includes purposeful modifications of the real-world data.
%   Thus, this data can be used for test methods and algorithms, but should not
%   be used to make claims regarding the operation or planning of the European
%   power system.
%
%   This specific network data is publicly released for the purpose of testing
%   methods and algorithms on challenging optimization problems and more
%   comprehensive in terms of grid models and versatile AC OPF formulations
%   (see details in [2], where two solvers in MATPOWER version 4.1 failed to
%   converge on two instances and Florin Capitanescu's AC-OPF solver failed to
%   converge on another instance). For example, [2] presented results for 16
%   variants of AC-OPF problems with different objective functions, sets of
%   decision variables (e.g. among: generators active/reactive powers, ratio of
%   LTC transformers, reactance of shunt capacitors/reactors, and angle of
%   phase shifter transformers) and constraints. Researchers seeking to include
%   control variables like transformer tap ratio, phase shifter angle and shunt
%   reactance can contact Florin Capitanescu for the associated data.
%
%   Besides this test case, all AC OPF instances presented in [2] can be easily
%   obtained using one or some combinations of following features:
%
%   - Setting the angle of all 84 phase shifters to 0.0.
%
%   - Using identical unity costs (c=1.0) for all generators to minimize the
%     sum of generators active powers (an unconventional loss minimization via
%     also active power re-dispatch) as an OPF objective function.
%
%   - Using a quadratic OPF objective function that minimizes the sum of
%     squares of each generator's active power deviation with respect to the
%     initial value Pgi^0 (provided in the data set), i.e. (Pgi-Pgi^0)^2. Thus,
%     the coefficients of these fictitious cost function in p.u. (100MVA base)
%     are, (0.01*Pgi^0)^2 - 2*0.01*Pgi^0 + 0.0001*Pgi^0.
%
%   - The thermal limit of line between nodes 746 and 5968 and can be decreased
%     on purpose from 2061 MVA to 1000 MVA to create congestion (around 20%
%     current overload) and a tough OPF problem, see [2].
%
%   If one faces convergence issues with your an NLP solver, the following
%   simplifications are suggested:
%
%   - Generators with small active power range (<=20MW) are not taken as
%     control variable, their active power is fixed to the initial value.
%
%   - Generators with small reactive power range (<=10MVAr) are not taken as
%     control variable, their reactive power is fixed to the initial value.
%
%   - The reactance of 98 short lines could be raised to the minimum threshold
